import React, { useState } from 'react';
import './Count.css'; // Assuming you have a Count.css file for styling

function Count() {
  const [data, setData] = useState(0);

  const increment = () => {
    setData(data + 1);
  };

  const decrement = () => {
    setData(data - 1);
  };

  return (
    <div className='count-container'>
      <p className='count-text'>Count: {data}</p>
      <div className='button-container'>
        <button className='count-button' onClick={decrement}>-</button>
        <button className='count-button' onClick={increment}>+</button>
      </div>
    </div>
  );
}

export default Count;
